    //     .then(() => { deleteUserFromStore(user)
    //     }) }
    // const editUser = () => { axios.put('http://localhost:3000/api/users/'+user.user_id,
    //     {"username": username}) .then(() => {
    //     editUserFromStore(user, username) })
    // }
    const userCardStyles: CSS.Properties = {
        display: "inline-block", height: "328px",
        width: "300px",
        margin: "10px",
        padding: "0px" }

    return (
        <Card sx={userCardStyles}>
            <CardMedia component="img"
                       height="200"
                       width="200"
                       sx={{objectFit:"cover"}}
                       image="https://png.pngitem.com/pimgs/s/150-1503945_transparent-user-png-default-user-image-png-png.png"
                       alt="Auction hero"
            />
            <CardContent>
            <Typography variant="h4"> {film.title} {film.ageRating}
            </Typography>
            </CardContent>
            <CardActions>
                <IconButton onClick={() => {setOpenEditDialog(true)}}>
                    <Edit/>
                </IconButton>
                <IconButton onClick={() => {setOpenDeleteDialog(true)}}>
                    <Delete/>
                </IconButton>
            </CardActions>
        </Card> )
}

    export default FilmListObject
